                        <h6 class=""card-title"">Executive Director, M.A. Ed</h6>
                        <p>Nourishing Hands Inc., a nonprofit organization which exists to r");
            WriteLiteral(@"educe the negative effects of poverty and inequality for African American and immigrant teens (ages 15-20). Our school-based model partners with high schools and connects teens from marginalized communities with professional and positive community members who share our organization’s vision. We serve DeKalb County zip codes 30083, 30072, 30021, 30088, and 30079. Compared to neighboring zip codes in a twenty-mile radius, the economic disparity is alarming and demands urgent intervention. NHI responds to this need through our mentoring program, which will help bridge opportunity gaps. </p>
                        <p>While the United States is undoubtedly the wealthiest nation on earth and a land of unparalleled opportunity for its people, the unfortunate truth is that one’s zip code is still determined by income, race and ethnicity. Data and statistics show that a zip code determines whether one has access to quality and affordable housing, jobs, healthcare, good schools, grocery stores/supermarkets, transport");
            WriteLiteral(@"ation and other basic necessities. Children in high-income zip codes tend to have access to better housing and schools, among other basic necessities, which in turn exposes them to more resources. They tend to perform much better academically and are more likely to graduate high school and attend college than their counterparts from low-income zip codes. </p>
                        <p>
                            To mitigate this disparity, NHI’s research focuses on four areas: race, income, education, and housing. Based on our research, NHI is teaming up with partners to provide mentoring services to teens and their parents residing in zip codes 30083, 30072, 30021, 30088, and 30079.
                            South DeKalb’s population is more than 70% black-identifying, with a median household income of $30,500, and median property/home value of  $151,000. Less than 30% of the population holds an advanced degree. Meanwhile black-identifying  people account for less than 20% of neighboring zip codes’ po");
            WriteLiteral(@"pulations, with a median household income of $59,908, and a median property value of $263,259. More than 40% of this neighboring population holds an advanced degree.
                        </p>
                        <p>Our goal is to create a strong, accountable program with trusting relationships between our participants and their mentors, which will foster experiences, growth, and opportunities. In order to provide an impactful program for teens who need extra support, we rely on our community partners to come together in support of our mission.</p>
                    </div>
                </div>
                <div class=""modal-footer"">
                    <button type=""button"" class=""btn btn-secondary"" data-dismiss=""modal"">Close</button>
                </div>
            </div>
        </div>
    </div>
