                        </div>
                        <div class=""courses_info"">
                            <h5 class=""courses_title""><a href=""#"">Wellness</a></h5>
                            <p>Data from the CDC shows that youth, especially teens engage in multiple behaviors that pose dangers to their health. A few of the harmful behaviors include: marijuana and tobacco usage, prescription opioids, alcohol, e-cigarettes, other illegal substance, physical inactivity, unbalanced diet, and insufficient sleep. In most cases multiple or several of these harmful behaviors coexist, and compounds the pain and anxiety teens experience. Our program helps participants set goals to lead a healthy lifestyle</p>

                        </div>
                    </div>
