                        </div>
                        <div class=""courses_info"">
                            <h5 class=""courses_title""><a href=""#"">Education</a></h5>
                            <p>There is huge disparity in college preparation and admission for African-America and immigrant teens from low-income who are first-generation college students. This problem has many factors to consider when measuring it, including SAT scores, Advanced Placement course taking and exam passage, enrollment in rigorous mathematics and science courses, high school graduation rates, and high school exit exams (Camara, 2013; Musoba, 2011). Our College Prep initiative seeks to change the data trend by equipping teens to be successful through the college admission process for enrollment to Historically Black Colleges and Universities.</p>

  ");
            WriteLiteral(@"                      </div>
                    </div>
                </div>
                <div class=""col-lg-6 col-md-6"">
                    <div class=""courses_box radius_all_10 box_shadow1 animation"" data-animation=""fadeInUp"" data-animation-delay=""0.4s"">
