                            <a href=""#""><img src=""assets/images/entrepreneur.jpg"" alt=""course_img3"" /></a>
                        </div>
                        <div class=""courses_info"">
                            <h5 class=""courses_title""><a href=""#"">Professional-Entrepreneur</a></h5>
                            <p>Since the late 1960s, researchers have noted large differences in employment and unemployment rates among black workers, Hispanic workers, and white workers, especially for younger workers. Early work experiences (part-time and in the summer) can provide valuable opportunities for teens to learn new skills, gain experience, expand their networks, and develop positive relationsh");
            WriteLiteral(@"ips with adults. With numerous industry changes, the overall employment prospects for youth has changed and so has our collective effort to ensure that disadvantaged teens have a shot at the workforce of the twenty-first century with advance skill sets for the competition.</p>

                        </div>
                    </div>
                </div>
                <div class=""col-lg-6 col-md-6"">
