                            <p>Financial literacy has been defined as “the ability to make effective decisions regarding the use and managemen");
            WriteLiteral(@"t of money” (Schagen & Lines, 1996, p. 91). Research suggests that with proper education African Americans are more likely to make more informed financial choices for individuals and their communities. Our program provides education on basic money management (budgeting, saving, and investing) to equip teens with skills necessary for successfully day to day financial transactions.<br /><br /></p>

